mapper.select:

select 

from jvd_banushi_shussobetsu
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SETTEI_NEN = #{setteiNen,jdbcType=DECIMAL}

mapper.delete:

delete from jvd_banushi_shussobetsu
where KETTO_TOROKU_BANGO = #{kettoTorokuBango,jdbcType=CHAR}
  and RACE_CODE = #{raceCode,jdbcType=CHAR}
  and SETTEI_NEN = #{setteiNen,jdbcType=DECIMAL}
